  {online : false}]

  }


  render(){
    <div className = ' contact'>
      <img className = 'avatar' src = {array.this.avatar}></img>
    <div className= 'container'>
      <h4 className= 'name' >{this.name}</h4>
      <div className = 'status'>
        {this.status}
        <p className = 'status-text'>{this.msg}</p> 
